import React from "react";

function ImagePopup() {
  return (
    <div className="popup popup_img popup_background_black">
      <div className="popup__container popup__container-img">
        <img
          className="popup__fullscreen-image"
          src={require("../images/photo_2022-12-07_15-50-21.jpg")}
          alt=""
        />
        <p className="popup__fullscreen-title">csh</p>
        <button
          className="popup__close"
          type="button"
          aria-label="Закрыть"
        ></button>
      </div>
    </div>
  );
}

export default ImagePopup;
